import React from 'react';

const About = () => {
  return (
    <div>
      <h1>About Page</h1>
      <p>Aplikasi Menghitung Probabilitas Tabrakan Pesawat Terbang adalah sebuah sistem yang memungkinkan pengguna untuk menghitung probabilitas tabrakan antara pesawat terbang. Sistem ini menyediakan alur berikut:

    Pengguna memilih cakupan area: Pengguna dapat memilih area tertentu di mana mereka ingin melakukan perhitungan probabilitas tabrakan. Pilihan cakupan area ini akan menjadi dasar dalam pengambilan data pesawat terbang.

    Sistem melakukan pengambilan data antar pesawat: Setelah pengguna memilih cakupan area, sistem akan mengambil data pesawat terbang yang berada di dalam cakupan tersebut. Data ini meliputi informasi seperti posisi, kecepatan, arah, dan identifikasi pesawat (misalnya ICAO24).

    Sistem menampilkan visualisasi map dan pesawat terbang: Setelah data pesawat terbang diperoleh, sistem akan menampilkan visualisasi map yang mencakup area yang dipilih oleh pengguna. Pada visualisasi ini, pesawat terbang akan ditampilkan sesuai dengan posisi dan arah terbangnya.

    Perhitungan probabilitas jika vektor antar pesawat bersinggungan: Sistem akan memeriksa vektor antar pesawat yang ada dalam data yang diperoleh. Jika terdapat pesawat yang memiliki vektor yang bersinggungan, sistem akan melakukan perhitungan probabilitas tabrakan antara pesawat-pesawat tersebut.

    Menampilkan presentase perhitungan: Setelah perhitungan probabilitas selesai dilakukan, sistem akan menampilkan presentase hasil perhitungan tersebut. Presentase ini memberikan informasi tentang tingkat risiko tabrakan antara pesawat-pesawat yang bersinggungan.

    Memberikan notifikasi kepada pengguna: Jika probabilitas tabrakan antara pesawat-pesawat yang bersinggungan melebihi ambang batas yang ditentukan, sistem akan memberikan notifikasi kepada pengguna. Notifikasi ini berfungsi sebagai peringatan agar pengguna dapat mengambil tindakan yang sesuai.

	Dengan menggunakan aplikasi ini, pengguna dapat memperoleh pemahaman yang lebih baik tentang risiko tabrakan pesawat terbang dalam suatu area tertentu. Hal ini dapat membantu pengguna dalam mengambil keputusan yang berkaitan dengan navigasi dan keselamatan penerbangan.
</p>
      {/* Add your content for the About page */}
    </div>
  );
};

export default About;
